import { UserNav } from "../../../component/Navbar/homeNav"
import { getPrinters } from "../../../data/data";
import '../Myprinters.css'
import { useNavigate } from "react-router-dom";
import { useEffect} from "react";
import { useState } from "react";

export default function Modify(){

    const [NamePrinter,SetNamePrinter] = useState("");
    const [Nozzles,SetNozzles] = useState(0);
    const [Soluble,SetSoluble] = useState(false);


    return(
        <div>
            <UserNav/>
            <table className="myPrinters">
                    <tbody>
                    <tr>
                        <th>Name</th>
                        <th>NozzlesMounted</th>
                        <th>Soluble</th>
                    </tr> 

                    <tr>
                        <th><input type="text" placeholder="Name" onChange={(event)=> SetNamePrinter(event.target.value)}/></th>
                        <th><input type="number" placeholder="nozzles"/></th>
                        <th><input type/></th>
                    </tr>

                    <button className="printerButton" onClick={()=> console.log(NamePrinter)}>Modify</button>
                   </tbody> 
                </table>
        </div>
    )
}
